import React from 'react';
import ReactDOM from 'react-dom';
import { Panel, PanelHeader, Epic, Tabbar, TabbarItem } from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

const App = () => {

  return (
        <Epic>
          <Tabbar>
            <TabbarItem
            onClick={this.onStoryChange}
            selected={this.state.activeStory === 'discover'}
            data-story="discover"
            text="Главная"
            ></TabbarItem>
            </Tabbar>
          </Epic>
  )
}
 export default App;
